// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

contract MBD_BANK {
    mapping(address => uint) balanceLedger;
    mapping(address => bool) userExitOrNot;

    event logTransactionFlow(address, string, uint);

    modifier mapUser() {
        if (userExitOrNot[msg.sender]) {
            balanceLedger[msg.sender] = msg.sender.balance;

            userExitOrNot[msg.sender] = true;
            emit logTransactionFlow(
                msg.sender,
                "New User mapped successfully",
                msg.sender.balance
            );
           
        }
         _;
    }

    function getBalance() public view returns (uint _userBalance) {
        
        return balanceLedger[msg.sender];
     
    }

    function depositMoney() public payable mapUser {
        //require amount greater than zero
        require(
            msg.value > 0,
            "Invalid Amount!!! Amount should be greater than zero"
        );
        
        balanceLedger[msg.sender] = balanceLedger[msg.sender] + msg.value;
        
        emit logTransactionFlow(
            msg.sender,
            "Money deposited successfully",
            balanceLedger[msg.sender] );
    }

    function  transferAmount(address payable to, uint amount) 
        public payable 
        mapUser
        returns (uint updatedBalance)
    {
        //require sender address balance greater or equal to sender amount
        //require sender address to be greater than zero
        // address payable   senderAddress =payable(msg.sender);
  
       
        require(
            amount > 0,
            "invalid Amount!!! amount should be greater than zero"
        );

        require(
            balanceLedger[msg.sender] >= amount,
            "insufficent balance to perform this transaction"
        );

        balanceLedger[msg.sender] = balanceLedger[msg.sender] - amount;
        to.transfer(amount);
    
        emit logTransactionFlow(
            to,
            "Money transfered successfully",
            to.balance
        );
        
        updatedBalance = balanceLedger[msg.sender];
       
    }
//25382
    function withdrawAmount(uint amount) public mapUser {
        //require user balance should be greater or equal to entered amount
        
        require(
            balanceLedger[msg.sender] >= amount,
            "insufficent balance to perform this transaction"
        );
        balanceLedger[msg.sender] = balanceLedger[msg.sender] - amount;

        emit logTransactionFlow(
            msg.sender,
            "Amount withdrawn successfully",
            balanceLedger[msg.sender]
        );
    }
}

